import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
       <Routes>
      <Route path='/' element={<Game />}></Route>
      <Route path='/game-easy' element={<GameEasy />}></Route>
      <Route path='/game-hard' element={<GameHard />}></Route>
     </Routes>
    </Router>
    </div>
  );
}

export default App;
